query:
DELETE FROM participants 
WHERE id IN (
  SELECT id FROM (
    SELECT id, ROW_NUMBER() OVER (PARTITION BY eventId, email ORDER BY id) as rn
    FROM participants
    WHERE email = 'lynnette.glory@gmail.com'
  ) t
  WHERE rn > 1
);

